import { UnsafeStyleProps } from '@noodl-core-ui/types/global';
import classNames from 'classnames';
import React from 'react';
import css from './Logo.module.scss';

export enum LogoVariant {
  Default = 'default',
  Inverted = 'inverted',
  Grayscale = 'grayscale'
}

export enum LogoSize {
  Small = 'small',
  Medium = 'medium',
  Large = 'large'
}

export interface LogoProps extends UnsafeStyleProps {
  variant?: LogoVariant;
  size?: LogoSize;

  onClick?: React.MouseEventHandler<HTMLDivElement>;
}

export function Logo({
  variant = LogoVariant.Default,
  size = LogoSize.Medium,
  onClick,
  UNSAFE_className,
  UNSAFE_style
}: LogoProps) {
  function VariantIcon(props: {}) {
    switch (variant) {
      default:
      case LogoVariant.Default:
        return <DefaultIcon />;
      case LogoVariant.Inverted:
        return <InvertedIcon />;
      case LogoVariant.Grayscale:
        return <GrayscaleIcon />;
    }
  }

  return (
    <div
      className={classNames([
        css['Root'],
        css[`is-variant-${variant}`],
        css[`is-size-${size}`],
        UNSAFE_className
      ])}
      onClick={onClick}
      style={UNSAFE_style}
    >
      <VariantIcon />
    </div>
  );
}

